        render: (text, record) => (
            <Space size="middle">
                <a>Edit</a>
                <a>Delete</a>
            </Space>
        ),
    },
];

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    }
]


class ListTable extends React.Component {
    render() {
        return (
            <Table columns={columns} dataSource={data} style={
                {
                    display : '75%',
                    margin : '0 auto',
                    background
                }
            } />
        )
    }
}

export default ListTable
